import ReactDOM from 'react-dom';
import React, { Component } from 'react';
import './Frontpage.css';

import { Link, Route, Switch } from 'react-router-dom';



const Product = (props) => { 



	

		return (
                    

            <div className='product'>
                <Link to={"/products/:id"}> <img className='product-image' src={props.image} alt='item image' /> </Link>
                        <div className='product-name'> <a href='product.html'>  {props.name} </a> </div>
                        <div className='product-brand'> {props.brand} </div>
                        <div className='product-price'> &#163;{props.price} </div>
                        <div className='product-rating'> 4.5 starts (20 reviews) </div>


                      </div>

                    


			
			)
	


}

export default Product;
